import {Component} from 'react'
import App from '../components/app';
import {activePage} from "../actions/actions";
import {connect} from 'react-redux'
import ContactUsSvg from '../public/media/contactSvg.svg';

const Section1 = (props) => {

    return (
        <section className="py-5">
            <div className="container">
                <div className={"row"}>
                    <div className="col-lg-6 text-lg-right text-center">
                        <h2 className="display-2">تواصل معنا</h2>
                        <p className="lead">
                            زائرنا الكريم لا تردد في ان تتواصل معنا رسالتك مهمه لنا وانت مرحب بك دائما
                        </p>
                    </div>
                    <div className={"col-lg-6 text-lg-right text-center mt-lg-0 mt-4"}>
                        <img src={ContactUsSvg} className={"w-100"}/>
                    </div>
                </div>
            </div>
        </section>
    )


};


const Section2 = (props) => {
    return (
        <section className="py-4">
            <div className="container">
                <div className="row">
                    <div className="col-6  " style={{borderLeft:"5px solid #EB095E"}}>
                        <form className="text-right" method="post">

                            <div className="form-group">
                                <label htmlFor="sender-name">اسم المرسل</label>
                                <input id="sender-name" className="form-control form-control-lg" name="fullName" placeholder="مثال : عبدالله محمد"/>
                            </div>

                            <div className="form-group">
                                <label htmlFor="sender-email">البريد الالكتروني</label>
                                <input id="sender-email" className="form-control form-control-lg" name="email" placeholder="مثال :example@gmail.com"/>
                            </div>

                            <div className="form-group">
                                <label htmlFor="message">رسالتك</label>
                                <textarea className="form-control form-control-lg" name="email" placeholder="قل شيئآ"></textarea>
                            </div>

                            <div className="form-group">
                                <button className="btn btn-primary">ارسال</button>
                            </div>
                        </form>
                    </div>
                    <div className="col-6">

                    </div>
                </div>
            </div>
        </section>
    )
}


class ContactUs extends Component {

    componentDidMount() {
        this.props.dispatch(activePage('contact_us'))
    }

    render() {

        return (
            <App>
                <Section1/>
                <Section2/>
            </App>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        ...state
    }
}
export default connect(mapStateToProps)(ContactUs);
